import React, { useEffect, useState } from 'react';
import './Resultat.css'
import axios from 'axios';
function Resultat() {
    const [teamsData, setTeamsData] = useState([]);

    useEffect(() => {
        // Utilisez useEffect pour appeler GetTeams lors du montage du composant
        async function fetchData() {
            const teamsData = await GetTeams();
            console.log('Équipes récupérées :', teamsData);
            setTeamsData(teamsData); // Met à jour l'état local avec les données récupérées

            // Vous pouvez faire quelque chose avec les données des équipes ici
        }

        fetchData();
    }, []); // Le tableau de dépendances vide signifie que useEffect s'exécutera une seule fois lors du montage

    return (
        <div className="body">
            <body className='App-body'>
                <p> Page de résultat en développement ! </p>
                <p>Nom de l'équipe : {teamsData}</p>
                {/* Ajoutez d'autres informations de l'équipe si nécessaire */}
            </body>
        </div>
    );
}

async function GetTeams() {
    const options = {
        method: 'GET',
        url: 'https://www.balldontlie.io/api/v1/teams',
        params: {
            page: '0',
            per_page: '25'
        },
    };

    try {
        const response = await axios.request(options);
        return response.data;
    } catch (error) {
        console.error(error);
        return [];
    }
}



export default Resultat;
